import Card from "./card";

function Grid(props) {
  const position = {
    container: "grid grid-cols-auto gap-4",
  };
  const design = {
    text: "text-gray-400",
  };

  return (
    <div className={position.container}>
      {props.products?.length ? (
        props.products.map((product) => (
          <Card key={product._id} product={product} />
        ))
      ) : (
        <p className={design.text}>No product found</p>
      )}
    </div>
  );
}

export default Grid;
